function dropDownClick(target, menu, button) {
    if (dropDownHovered == false) {
        dropDownClicked = true;
        var button = document.getElementById(button);
        $.each($(button).siblings(), function () {
          if(this.tagName!="svg" && this.tagName!="use") {
            this.className = this.className.replace(" active", "");
          }
        });
        button.className = button.className.replace(button.className, button.className + " active");
        var element = document.getElementById(target);
        var currentClass = element.className;
        $.each($(element).siblings(), function () {
          if(this.tagName!="svg" && this.tagName!="use") {
            this.className = this.className.replace(" active", "");
          }
            TweenLite.to(element, 0, { height: 0 }, { force3D: true, ease: Quad.easeInOut });
        });
        if (element.className.indexOf(" active") == -1) {
            element.className = element.className.replace(currentClass, currentClass + " active");
            TweenLite.to(element, .25, { height: $(element).attr('originalheight') }, { force3D: true, ease: Quad.easeInOut });
        }
        else {
            element.className = element.className.replace(" active", "");
            TweenLite.to(element, 0, { height: 0 }, { force3D: true, ease: Quad.easeInOut });
        }
        currentTarget = element.id;
        currentMenu = menu;
        currentButton = button.id;
        snapOn(currentMenu);
        $(element).trigger($.Event('heightchange'));
    }
}

function snapOn(menu) {
    var prevMatch = "";
    var prevMatchElem = "";
    for (i = 0; i < top_nav_menu_.length; i++) {
        var menuitem = document.getElementById(menu + i);
        if (menuitem == null) {
            return false;
        }
        menuitem.className = menuitem.className.replace(/(?:^|\s)url_on(?!\S)/g, ' url_off ');
        if (location.pathname.indexOf(snapOnSection[i]) != -1 && menuitem.className.indexOf('url_off') != -1 && prevMatch == "") {
            menuitem.className = menuitem.className.replace(/(?:^|\s)url_off(?!\S)/g, ' url_on ');
            prevMatch = snapOnSection[i];
            prevMatchElem = menuitem;
        }
        if (location.pathname.indexOf(snapOnSection[i]) != -1 && menuitem.className.indexOf('url_off') != -1 && prevMatch != "") {
            if (prevMatch.split("/").length < snapOnSection[i].split("/").length) {
                prevMatchElem.className = prevMatchElem.className.replace(/(?:^|\s)url_on(?!\S)/g, ' url_off ');
                menuitem.className = menuitem.className.replace(/(?:^|\s)url_off(?!\S)/g, ' url_on ');
            }
        }
    }
}

function snapOff(menu) {
    for (i = 0; i < top_nav_menu_.length; i++) {
        var menuitem = document.getElementById(menu + i);
        if (menuitem) {
            menuitem.className = menuitem.className.replace(/(?:^|\s)url_on(?!\S)/g, ' url_off ');
        }
    }
}

