        $outer.css("top", $(document).scrollTop() + "px")
        $(inner).css("margin-left", (-$(inner).outerWidth() / 2) - (($(inner).css("padding-left").replace("px", "") / 2) + 1) - ($content_offset) + 12 + "px");


        var headerHeight = 0;
